Text:
The timing for the Chinese rocket reentering Earth's atmosphere has narrowed — but no one is quite sure where it will land yet. 

There’s so much uncertainty because the rocket is moving at 18,000 mph, 
@AllisonChinchar explains. https://t.co/elBSKQ55D3 https://t.co/IpEf15FZPy

“It’s all about challenging myself and testing those unknowns."

@des_linden reflects on setting a new 50km record, the first woman to run the distance in under three hours. 

Via @cnnsport: https://t.co/T2JhdYmsxe https://t.co/JU4IB8Ln2o

As India reports its highest ever daily surge of coronavirus cases, CNN's 
@clarissaward visits a crematorium in the country's holiest city on the banks of Ganges River. 

The situation "has become so bad that shortages have been reported of wood, needed for the funeral pyres." https://t.co/xGgY37Tm6j

"Freedom of speech ain't free when you're a Black woman."

@LisaFranceCNN &amp; @DonLemon on the price Eartha Kitt paid for speaking out against the Vietnam War in 1968.

Listen to this week's episode of Silence is Not an Option. https://t.co/HuE4OM5SyS https://t.co/1ky95z3b9f

“If you're going to be an ally, you’ve gotta be a loud, screaming, boisterous ally.”

@DonLemon and @ChrisCuomo discuss why they think President Biden hasn’t taken bold enough action to protect voting rights.

That’s on the latest episode of The Handoff. https://t.co/TyqHSaYTwr

“This is my motherhood for Blake, to make sure that his short two years meant something...to make sure my son did not die in vain.” 

@Rene_MarshCNN shares how the death of her son Blake motivated her to advocate for #ChildhoodCancer research. 

Listen. https://t.co/vjvOl35zh2 https://t.co/fccNIaVJ7S

We’ve discussed the politics, the celebrity, and the controversy of the 2003 California recall election, now it’s time to hear about it from the man himself. 

@Schwarzenegger talks about it all in an in-depth interview with @DanaBashCNN. 

Listen now. https://t.co/BL7tgogRBg https://t.co/JSxxRq1QLH

"Medicine has a long history of mistreating certain populations." 

@DrNundy and @DrSanjayGupta discuss how we can restore trust in our medical institutions. 

Listen to this week's podcast. https://t.co/j5TWrApSJu https://t.co/g0LY0OQHkT

It's that time of year again: Time to turn back the clocks—something nearly 70% of Americans say they dislike. 😒⏰

@ForecasterEnten asks if so many people hate Daylight Saving Time, why haven't we settled on an alternative?

Listen to Margins of Error. https://t.co/V34fyrMj7M

“If you’re explaining, you’re losing.”

@donlemon and @ChrisCuomo dissect issues around Democrats’ political messaging and how that played out in Tuesday’s election.

Listen to The Handoff. https://t.co/8BHbFOU1VX

Syrian activists believed documenting the war would lead to international support for regime change. Instead, they feel "let down by the world." 

@ClarissaWard tells the stories of Syrian activists fighting an endless war. 

Listen to the podcast. https://t.co/5sykHRNm97 https://t.co/pzADjxEhkR
